pragma solidity 0.6.3;

contract Dex {

    address public admin;
    
    // Token management
    struct Token {
        bytes32 ticker;
        address tokenAdress;
    } 
    mapping(bytes32 => Token) public tokens;
    bytes32[] public tokenList; // List to keep track of the Tickers in order to be able to loop through the mapping

    // Wallet management
    mapping(address => mapping(bytes32 => uint32)) public traderBalances; // Address => Ticker => Amount

    constructor() public {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin");
        _;
    }

    // To
    function addToken(bytes32 ticker, address tokenAddress) onlyAdmin() external  {
        tokens[ticker] = Token(ticker, tokenAddress);
        tokenList.push(ticker);
    }
}
